import { Box, Image, Text } from "@chakra-ui/react";
import { motion } from "framer-motion";
import Header from "../Component/Header";
import errorImg from "../Assets/404/dog-astronaut.png";
const NotFound = () => {
  return (
    <motion.div
      intial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      exit={{ opacity: 0 }}
    >
      <Header />
      <Box display={{sm:'flex'}} flexDirection={{}}>
        <Image
          src={errorImg}
          boxSize={"40%"}
          // position={"relative"}
          // left={"5%"}
          // mt={"5"}
          alt={"error"}
        />
        <Text
          // fontSize={"7xl"}
          fontWeight={"extrabold"}
          // position={"absolute"}
          // top={"70%"}
          // left={"45%"}
        >
          Oops Page Not Found
        </Text>
      </Box>
    </motion.div>
  );
};

export default NotFound;
